snippet.description:
Alyssa tries the Giftinthebox Make Up Kit Pretend Toy for kids with ate Chay.

Complete Kids Pretend Makeup Set
Giftinthebox realistic pretend makeup kit contains a cute pink handbag, sunglasses, pretend lipstick, blusher, eyeshadow, powder, makeup brushes, glitters, nail polish, mascara, giftcard... It's so much fun to play dress up!

